// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "./CrossChainBase.sol";
import "../interfaces/IRoutersCore.sol";

contract CrossChain is CrossChainBase {
    IRoutersCore private routersCoreContract;
    mapping(string => Group[][]) private cachedMessageTable;
    mapping(string => uint256[]) private pendingMessageKeys;
    mapping(string => mapping(address => uint256)) private finalReceivedMessageId;

    event Verification(string chainName, uint256 id, uint256 errorCode);

    modifier onlyRouter() {
        require(routersCoreContract.isSelected(msg.sender), "Caller not router");
        _;
    }

    constructor(string memory _chainName) CrossChainBase(_chainName) {
    }

    /**
     * @dev Internal method to deal received messages
     */
    function internalReceiveMessage(IReceivedMessage memory _message) internal {
        uint256 nextMessageId = this.getNextMessageId(_message.fromChain, msg.sender);
        require(_message.id == nextMessageId, "CrossChain: id not match");

        // update received message id
        finalReceivedMessageId[_message.fromChain][msg.sender] = _message.id;

        Group[][] storage chainMessages = cachedMessageTable[_message.fromChain];
        // get groups
        Group[] storage groups;
        if (_message.id == chainMessages.length + 1) {
            groups = chainMessages.push();
            pendingMessageKeys[_message.fromChain].push(_message.id);
        }
        else {
            groups = chainMessages[_message.id - 1];
        }

        // get group        
        bytes32 hash = keccak256(abi.encode(_message));
        Group storage group;
        bool found = false;
        for (uint256 i = 0; i < groups.length; i++) {
            if (groups[i].hash == hash) {
                group = groups[i];
                found = true;
                break;
            }
        }

        if (!found) {
            group = groups.push();
            group.hash = hash;
            group.message.id = _message.id;
            group.message.fromChain = _message.fromChain;
            group.message.toChain = _message.toChain;
            group.message.sender = _message.sender;
            group.message.signer = _message.signer;
            group.message.contractAddress = _message.contractAddress;
            group.message.action = _message.action;
            for (uint i = 0; i < _message.data.items.length; i++) {
                group.message.data.items.push(_message.data.items[i]);
            }
            for (uint i = 0; i < _message.sqos.length; i++) {
                group.message.sqos.push(_message.sqos[i]);
            }
            group.message.session = _message.session;
            group.message.errorCode = _message.errorCode;
        }
        else {
            group = group;
        }

        group.routers.push(routersCoreContract.getRouterById(msg.sender).id);

        // get the number of routers that have submitted messages
        uint256 len = 0;
        for (uint256 i = 0; i < groups.length; i++) {
            len += groups[i].routers.length;
        }

        if (len >= routersCoreContract.getSelectedRoutersNumber()) {
            address[][] memory verifyGroups = new address[][](groups.length);
            for (uint256 i = 0; i < verifyGroups.length; i++) {
                verifyGroups[i] = groups[i].routers;
            }
            (uint256 errorCode, uint256 groupIndex) = routersCoreContract.verifyMessage(verifyGroups);
            _receiveMessage(groups[groupIndex].message, errorCode == 0);
            emit Verification(groups[groupIndex].message.fromChain, groups[groupIndex].message.id, errorCode);
            uint256[] storage pendingKeys = pendingMessageKeys[_message.fromChain];
            for (uint256 i = 0; i < pendingKeys.length; i++) {
                if (pendingKeys[i] == _message.id) {
                    pendingKeys[i] = pendingKeys[pendingKeys.length - 1];
                    pendingKeys.pop();
                    break;
                }
            }
        }
    }

    /**
     * @dev See ICrossChain
     */
    function receiveMessage(IReceivedMessage calldata _message) external override onlyRouter {
        internalReceiveMessage(_message);
    }

    /**
     * @dev Cross-Chain abandons message from chain `_fromChain`, the message will
     * be skipped and not be executed.
     */
    function abandonMessage(string calldata _fromChain, uint256 _id, uint256 _errorCode) external onlyRouter {
        IReceivedMessage memory _message;
        _message.fromChain = _fromChain;
        _message.id = _id;
        _message.errorCode = _errorCode;
        internalReceiveMessage(_message);
    }

    /**
     * @dev Returns the next message id which will be received from chain `chainName`
     * @param chainName: The chain name from which routers query messages
     * @param router: The address of the router which will port messages
     * @return id: The message id
     */
    function getNextMessageId(string calldata chainName, address router) external view returns (uint256) {
        uint256[] storage pendingIds = pendingMessageKeys[chainName];
        uint256 routerFinalId = finalReceivedMessageId[chainName][router];
        for (uint256 i = 0; i < pendingIds.length; i++) {
            if (pendingIds[i] > routerFinalId) {
                return pendingIds[i];
            }
        }

        return cachedMessageTable[chainName].length + 1;
    }

    /**
     * @dev Sets the address of the RouterCore contract
     * @param _address: The address of the RouterCore contract
     */
    function setRouterCoreContractAddress(address _address) external onlyOwner {
        routersCoreContract = IRoutersCore(_address);
    }

    function clearCrossChainMessage(string calldata chainName) external onlyOwner {
        delete cachedMessageTable[chainName];
        delete pendingMessageKeys[chainName];
        delete sentMessageTable[chainName];
        delete receivedMessageNumber[chainName];
        delete executableMessageTable[chainName];
        delete abandonedMessageTable[chainName];
        address[] memory routers = routersCoreContract.getRouters();
        for (uint256 i = 0; i < routers.length; i++) {
            delete finalReceivedMessageId[chainName][routers[i]];
        }

        for (uint256 i = 0; i < receivedMessageNumber[chainName]; i++) {
            delete receivedMessageTable[chainName][i];
        }
    }
}

